const zlib = require("zlib");
const decompress = (data) => zlib.inflateRawSync(Buffer.from(data));

// leb128
function Ab76(e) {
    for (var t = 0, r = 0;;) {
        var n = e.d[e.i++];
        t |= (127 & n) << r
        r += 7
        if (0 == (128 & n)) 
            if (r < 32 && 0 != (64 & n)) 
                return t | -1 << r;
            else 
                return t;
    }
}
function Ab27(e) {
    var na;
    na = [null];
    for (var t = -1, r = new Array();;) {
        var n = e.d[e.i++];
        if (n >= 128 && n < 192) t = (t << 6) + (63 & n);
        else if (t >= 0 && r.push(t), n < 128) t = n;
        else if (n < 224) t = 31 & n;
        else if (n < 240) t = 15 & n;
        else {
        if (!(n < 248)) break;
        t = 7 & n;
        }
    }
    return String.fromCodePoint.apply(na[0], r);
}

